function Get-FileHash {
    <#
    .SYNOPSIS
        Get hash of file content for change detection
    #>
    [CmdletBinding()]
    param(
        [Parameter(Mandatory)]
        [string]$Path
    )

    if (-not (Test-Path $Path)) {
        return $null
    }

    $hash = Get-FileHash -Path $Path
    return $hash.Hash
